def jsfuck_to_js(jsfuck_code):
    # 定义一些基本的映射关系
    mappings = {
        '![]': 'false',
        '!![]': 'true',
        '+[]': '0',
        '+![]': '1',
        '[]': '[]',
        '()': '()'
    }

    # 解析字符串构建
    def parse_string(expr):
        parts = []
        while expr:
            if expr.startswith('![]'):
                parts.append('false')
                expr = expr[3:]
            elif expr.startswith('!![]'):
                parts.append('true')
                expr = expr[4:]
            elif expr.startswith('+[]'):
                parts.append('0')
                expr = expr[3:]
            elif expr.startswith('+![]'):
                parts.append('1')
                expr = expr[4:]
            elif expr.startswith('(') and expr.endswith(')'):
                parts.append(parse_string(expr[1:-1]))
                expr = ''
            else:
                raise ValueError(f"Unknown expression: {expr}")
        return ''.join(parts)

    # 解析数组索引
    def parse_index(expr):
        base, index = expr.split('][', 1)
        base = parse_string(base[1:])
        index = parse_string(index[:-1])
        return f"{base}[{index}]"

    # 解析函数调用
    def parse_function_call(expr):
        func, args = expr.split('(', 1)
        func = parse_string(func)
        args = parse_string(args[:-1])
        return f"{func}({args})"

    # 主解析函数
    def parse_expression(expr):
        if expr.startswith('[') and expr.endswith(']'):
            return parse_index(expr)
        elif '(' in expr and ')' in expr:
            return parse_function_call(expr)
        else:
            return parse_string(expr)

    # 分割代码为多个表达式
    expressions = jsfuck_code.split(';')
    result = []

    for expr in expressions:
        if expr.strip():
            result.append(parse_expression(expr))

    return ';'.join(result)

